social_posts.post_text:
breaking news: @samanthajaneyt and i agree on a mascara 

TLDW:
@benefitcanada came out with a new mascara called “fan fest” it’s pretty good, grips and coats the lashes well without clumping and still giving length. It *does* transfer on the bottom lashes even after I set my undereyes, someone at work even had to mention it to me after about an hour of wear so be forewarned about that. I don’t mind since I like to use two different mascaras for my top and bottoms. It beats out roller lash for the overall look of my lashes (but RL doesn’t transfer on my bottoms sooo ya.) Solid 9/10, would repurchase and recommend. I’ve been wearing it daily since I got it.
